se každoročně jezdí i na horských kolech v Jihoafrické republice.\r\nRozhodně Vám již došlo, že mám na mysli etapový závod dvojic Cape Epic. Právě\r\nse nedávno na jihu Afriky rozběhl. V druhé etapě tohoto závodu zaznamenala\r\nčeská cyklistika obrovský úspěch, který zajistil Martin Stošek. Ten společně se\r\nsvým belgickým týmovým kolegou Woutem Allemanem zaznamenali etapový triumf.</b></p>\r\n\r\n<p class=\"MsoNormal\">Druhá etapa byla <b style=\"mso-bidi-font-weight:normal\">po\r\nprologu a úvodní etapě třetím závodním dnem</b>. Na ten organizátoři připravili\r\n66km dlouhou časovku s převýšením 950 metrů. Na tento prašný a technicky\r\nnáročnou trasu se jezdci vydávali pouze v týmových dvojicích. <b style=\"mso-bidi-font-weight:normal\">Jednalo se o nejdelší časovku v historii\r\nzávodu</b>.</p><p class=\"MsoNormal\"><img src=\"https://cdn1.sportngin.com/attachments/photo/c8cf-209421394/ACE25_Profiles_v3_Stage-2.jpg\" alt=\"https://cdn1.sportngin.com/attachments/photo/c8cf-209421394/ACE25_Profiles_v3_Stage-2.jpg\" width=\"1143\" height=\"559\" class=\"shrinkToFit\"></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Belgicko-česká\r\ndvojice z týmu Buff Megamo (Stošek a Alleman</b>) se do závodu vydala jako 12.\r\nod konce. Jako poslední stáli na startu dosavadní lídři závodu Schurter a\r\nColombo. <b style=\"mso-bidi-font-weight:normal\">Už od úvodu bylo jasné, že tým\r\nBuff Megamo bude usilovat o čelní příčky</b>. Na úvodních mezičasech byli v\r\nkontaktu s těmi nejlepšími a postupně zrychlovali. <br></p><p class=\"MsoNormal\"></p><p></p><div class=\"iframe\"><blockquote class=\"instagram-media\" data-instgrm-permalink=\"https://www.instagram.com/p/DHVP4iPoelU/?utm_source=ig_embed&amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-w