; width: 144px;\"></div></div></a><p style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; line-height:17px; margin-bottom:0; margin-top:8px; overflow:hidden; padding:8px 0 7px; text-align:center; text-overflow:ellipsis; white-space:nowrap;\"><a href=\"https://www.instagram.com/p/DHVP4iPoelU/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" color:#c9c8cd; font-family:Arial,sans-serif; font-size:14px; font-style:normal; font-weight:normal; line-height:17px; text-decoration:none;\" target=\"_blank\">Příspěvek sdílený Cape Epic (@capeepic)</a></p></div></blockquote> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br><p></p>\r\n\r\n<p class=\"MsoNormal\">Cílovou pásku <b style=\"mso-bidi-font-weight:normal\">Stošek\r\ns Allemanem protnuli v čase 2h 13min a 5s</b>. Tento čas nakonec už žádný z\r\ntýmů nepřekonal, tudíž tým <b style=\"mso-bidi-font-weight:normal\">Buff Megamo\r\nmohl slavit etapové vítězství a posun na 8. místo celkově</b>. Druhý nejlepší\r\nčas dne byl o pouhých 27 vteřin horší než ten vítězný a zaznamenala ho\r\nšvýcarská <b style=\"mso-bidi-font-weight:normal\">dvojice Schurter a Colombo,\r\nkterá si tak upevnila celkové vedení</b>. Třetí místo v etapě brali italové\r\nAvondetto a Braidot, kteří jsou celkově druzí.</p><p class=\"MsoNormal\"></p><p></p><div class=\"iframe\"><blockquote class=\"instagram-media\" data-instgrm-permalink=\"https://www.instagram.com/p/DHVaOuTMdWr/?utm_source=ig_embed&amp;utm_campaign=loading\" data-instgrm-version=\"14\" style=\" background:#FFF; border:0; border-radius:3px; box-shadow:0 0 1px 0 rgba(0,0,0,0.5),0 1px 10px 0 rgba(0,0,0,0.15); margin: 1px; max-width:540px; min-width:326px; padding:0; width:99.375%; width:-webkit-calc(100% - 2px); width:calc(100% - 2px);\"><div style=\"padding:16px;\"> <a href=\"https://www.instagram.com/p/DHVaOuTMdWr/?utm_source=ig_embed&amp;utm_campaign=loading\" style=\" background:#FFFFFF; line-height:0; padding:0 0; text-align:center; text-dec