ován jihoafrický etapový závod Cape Epic. Ten se dnes\r\nčtvrtou etapou překlopil do své druhé poloviny. Největší českou nadějí v Africe\r\nje letos Martin Stošek, který závodí po boku Belgičana Wouta Allemana. Úvodní\r\ndva dny závodu jim nevyšli, ale od té chvíle jejich výsledky mají rostoucí\r\ntendenci. Dnes se dokázali udržet s nejlepšími a bojovali ve sprintu o\r\nvítězství. To nakonec získala italská dvojice Avondetto a Braidot. Belgicko-česká\r\ndvojice do cíle dorazila na 3. místě.</b></p>\r\n\r\n<p class=\"MsoNormal\">Čtvrtá etapa jihoafrického závodu začínala i končila u města\r\nPaarl, kde se nachází zázemí závodu. Cyklisté dnes museli absolvovat 80km na <b style=\"mso-bidi-font-weight:normal\">extrémně prašných cestách a trailech, které\r\njsou pro Cape Epic typické</b>. Závodníci se dnes museli popasovat s celkovým převýšením\r\nblížícím se dvěma tisícům metrů.</p><p class=\"MsoNormal\"><img src=\"https://cdn1.sportngin.com/attachments/photo/ba2b-209279035/ACE25_Profiles_v3_Stage_4.jpg\" alt=\"https://cdn1.sportngin.com/attachments/photo/ba2b-209279035/ACE25_Profiles_v3_Stage_4.jpg\" class=\"shrinkToFit\" width=\"1143\" height=\"559\"></p>\r\n\r\n<p class=\"MsoNormal\">Hned od úvodu byla velmi aktivní jihoafrická dvojice Joubert\r\na Nortje, která zapříčinila úvodní selekci. Po ní zůstaly <b style=\"mso-bidi-font-weight:\r\nnormal\">na čele 4 skupiny včetně lídrů závodu</b>. Stošek s Allemanem ale\r\núvodní nástup nezachytili a jeli ve druhé skupině. Postupně ale stahovali\r\nztrátu. Nakonec se jim povedlo čelo dojet, v tu chvíli <b style=\"mso-bidi-font-weight:\r\nnormal\">to vypadalo, že o vítězství bude bojovat 7 dvojic</b>.</p><p class=\"MsoNormal\"></p><p></p><div class=\"iframe\"><iframe class=\"instagram-media instagram-media-rendered instagram-media-rendered instagram-media-rendered\" id=\"instagram-embed-0\" src=\"https://www.instagram.com/reel/DHabA3mItZd/embed/?cr=1&amp;v=14&amp;wp=810&amp;rd=https%3A%2F%2Fwww.admin.cyklistickey.cz&amp;rp=%2Fedit%2Fupravit.php%3Fid%3D805#%7B%22ci%22%3A0%2C%22os%22%3A620%2C%22ls%22%3A122%2C%22le%22%3A582%7D\" allowtransparency=\"true\" allowfullscreen=\"true\" frameborder=\"0\" height=\"622\" data-instgrm-payload-id=\"instagram-media-payload-0\" scrolling=\"no\" style=\"background: white; max-width: 540px; width: calc(100% - 2px); border-radius: 3px; border: 1px solid rgb(219, 219, 219); box-shadow: none; display: block; margin: 0px 0px 12px; min-width: 326px; padding: 0px;\"></iframe> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br><p></p>\r\n\r\n<p class=\"MsoNormal\">V závěrečném sjezdu ale lídři závodu <b style=\"mso-bidi-font-weight:\r\nnormal\">Schurter a Colombo nastolili takové tempo</b>, že v první skupině\r\nzůstaly pouze čtyři skupiny včetně Stoška s Allemanem. <b style=\"mso-bidi-font-weight:\r\nnormal\">V závěru Martin Stošek zaútočil, ale jeho pokus bohužel nevyšel.</b>\r\nNakonec Belgicko-čeká dvojice obsadila třetí místo za druhými Švýcary Schurtrem\r\na Colombem. <b style=\"mso-bidi-font-weight:normal\">Vítězství zaznamenali\r\nItalové Braidot a Avondetto</b>.</p><p class=\"MsoNormal\"></p><p><p></p><div class=\"iframe\"><iframe src=\"https://www.facebook.com/plugins/video.php?height=476&amp;href=https%3A%2F%2Fwww.facebook.com%2Freel%2F528397770290796%2F&amp;show_text=false&amp;width=267&amp;t=0\" width=\"267\" height=\"476\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"></iframe></div><br></p><p></p><p class=\"MsoNormal\"></p><p></p><p></p><p class=\"MsoNormal\"></p><p></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">V celkovém pořadí se Martin\r\nStošek a Woutem Allemanan vyhoupli na 5. místo</b>. Na třetí místo tato dvojice\r\nztrácí pět a půl minuty. První dvě dvojice jsou od zbytku pole odskočeny skoro\r\no 10 minut. <b style=\"mso-bidi-font-weight:normal\">Celkově vedou Švýcaři\r\nColombo a Schurter</b>, ale jejich <b style=\"mso-bidi-font-weight:normal\">náskok\r\nna Italy Braidota a Avondetta činí pouhých 42 sekund</b>, což do posledních 3\r\netap slibuje atraktivní podívanou.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Mezi ženami <b style=\"mso-bidi-font-weight:normal\">pokračovala\r\nv krasojízdě argentinsko-dánská dvojice Annika Langvad a Sofia Gomez Villafane.\r\n</b>Tato dvojice na trati strávila 3h 50min 45s, což bylo o 50 sekund méně než\r\ndruhá dvojice Vera Looser a Alexis Skarda. <b style=\"mso-bidi-font-weight:normal\">Pořadí\r\nv etapě aktuálně odpovídá i celkovému pořadí</b>. Po dnešku se náskok Anniky\r\nLangvad a Sofie Gomes Villafane přehoupl přes hranici 10min.</p><p class=\"MsoNormal\"></p><p></p><div class=\"iframe\"><iframe class=\"instagram-media instagram-media-rendered\" id=\"instagram-embed-2\" src=\"https://www.instagram.com/reel/DHaufJzoEmU/embed/?cr=1&amp;v=14&amp;wp=810&amp;rd=https%3A%2F%2Fwww.admin.cyklistickey.cz&amp;rp=%2Fedit%2Fupravit.php%3Fid%3D805#%7B%22ci%22%3A2%2C%22os%22%3A631%2C%22ls%22%3A122%2C%22le%22%3A582%7D\" allowtransparency=\"true\" allowfullscreen=\"true\" frameborder=\"0\" height=\"882\" data-instgrm-payload-id=\"instagram-media-payload-2\" scrolling=\"no\" style=\"background: white; max-width: 540px; width: calc(100% - 2px); border-radius: 3px; border: 1px solid rgb(219, 219, 219); box-shadow: none; display: block; margin: 0px 0px 12px; min-width: 326px; padding: 0px;\"></iframe> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br><p></p>\r\n\r\n<p class=\"MsoNormal\">Kompletní výsledky naleznete <a href=\"https://my.raceresult.com/329222/results#1_B7863B\" target=\"_blank\"><b>ZDE</b></a></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Myslíte si, že se Stoškovi\r\ns Allemanem podaří prokousat na celkové pódium?</b></p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><br></b></p><p class=\"MsoNormal\">zdroj úvodní fotografie: ceskysvazcyklistiky.cz <br></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">&nbsp;</b></p>\r\n\r\n                ', 6, 'dvojice-stosek-a-alleman-ukoristila-treti-misto-ve-ctvrte-etape-cape-epic-');
